import React, { FC } from "react"
import { BrowserRouter as Router } from "react-router-dom"
import { Profile } from "../Profile/Profile"
import { ProfileNav } from "../ProfileNav/ProfileNav"
import { ProfileContent } from "./ProfileContent"

type props = {
  toggle: any
  postNews: any
}

export const Content: FC<props> = React.memo(
  ({ toggle, postNews }) => {
    return (
      <Router>
        <Router>
          <Profile />
          <ProfileNav />
          <ProfileContent toggle={toggle} postNews={postNews} />
        </Router>
      </Router>
    )
  },
  (prevProps, nextProps) => {
    console.log(prevProps, nextProps)
    if (nextProps.postNews < 1) {
      return false
    } else {
      return true
    }
  }
)
